import React, {useState, useEffect} from 'react';
import { Fragment } from 'react';
import './javascriptcatagorycontent.css';

function HTMLCatagoryContent(props) {

    const [htmlDef, sethtmlDef] = useState([]);


    const url = 'https://warm-harbor-96907.herokuapp.com/api/subjects/';

    useEffect(()=> {
        fetch(url)
        .then(res => res.json())
        .then(res => {
            sethtmlDef(res)
        })
    },[])

    console.log(htmlDef)

    return (
        <Fragment>

            <div className='focusSummary'>
                <h1>{htmlDef[1].focus}</h1>
                <h4>{htmlDef[1].focusDefinition}</h4>
            </div>

            <div className="content" dangerouslySetInnerHTML={{__html: htmlDef[1].focusContent}}></div>

        </Fragment>
    );
}

export default HTMLCatagoryContent;
